As reported in our paper, we trained the original dbcnn on five different databases with different MOS scales.&nbsp;
The dbcnn was originally implemented using Matconvnet.&nbsp;We didn’t reimplement all details in the pytorch version. We provide two examples of training our model on live or live-c. To train it on other datasets, you need to write the corresponding dataloaders.&nbsp;
To use the demo.py, you should first train a model on a dataset, on which the output range depends.



